3.2

- run the snippet below, which creates a Text and StyledText, each with WRAP
- on each keystroke the result of getLineCount() is printed
  -> the Text widget answers this based on the number of visible wrapped lines
  -> the StyledText answers this based on the number of cr's, so if you type a long sentence that wraps to 5 lines the result of getLineCount will still be 1

public static void main(String[] args) {
	Display display = new Display();
	Shell shell = new Shell(display);
	shell.setBounds(10,10,400,200);
	final Text text = new Text(shell, SWT.WRAP);
	text.setBounds(10,10,150,150);
	text.addListener(SWT.KeyDown, new Listener() {
		public void handleEvent(Event event) {
			System.out.println("Text: " + text.getLineCount());
		}
	});
	final StyledText styledText = new StyledText(shell, SWT.WRAP);
	styledText.setBounds(210,10,150,150);
	styledText.addListener(SWT.KeyDown, new Listener() {
		public void handleEvent(Event event) {
			System.out.println("StyledText: " + styledText.getLineCount());
		}
	});
	shell.open();
	while(!shell.isDisposed()) {
		if(!display.readAndDispatch()) display.sleep();
	}
	display.dispose();
}

