I tried to create a web page that can be used to upload a file from the browser o the web server.
When I select a file and click submit the HttpServletRequestImpl class throws an exception(from parseHeaders() method) before my servlet's doPost method is invoked. The source code contains a comment:

		/* Now we get to the headers. */
		// BUGBUG Headers can be repeated! getHeader must return the first header
		// in the request. The (2.2) getHeaders method can be used to get all
		// the headers' values.
		// Servlet 2.2 Section 5.3

I don't understand this comment clearly but it is sure that the code does not handle multipart/form-data http requests (the separator of the multipart request will be treated as the next request's header and that causes an exception in the header's parser).

The same example works fine on the Knopnerfish web server.

The web page is the following:

<html><body><h1>file upload</h1><form method="POST" enctype='multipart/form-data'><input type="hidden" name="alma" value="korte"><input alt="File" type="file" name="file1"><input type="submit" name="aaaaa" value="aaa"></form></body></html>

Fixed.

I did some more digging on this one. It turns out the problem was with display:none in the CSS. JAWS reads web pages by asking IE what it sees, instead of using the speech/aural CSS as it should. So getting it to read invisible things isn't straightforward. I had to use this workaround:

#navigation-links a .link-label { 
	position: absolute;
	left: -999px;
	width: 990px;
}

instead of display:none. It basically moves the text far from the visible screen, but the right border of the box slightly overlaps with the visible region, causing the browsers to think it's visible to the user. This workaround is mentioned on several websites as being the best one.

I tested on all the browsers and saw no change in appearance. The screen readers now read it properly. For example, tabbing through the top you'll hear "Overview link, Samples link, ..."

I am working to shorten the time and frustration involved to get the OHF PIX/PDQ plugins running when taken from CVS. Until the root problem to bugzilla report 151023 is resolved, I encourage committing these 2 workarounds. Both workarounds allow the code to continue when the 'name' variable is null by using the 'path' variable which has the 'name' value as a subset of it's contents.

Project: org.eclipse.ohf.hl7v2.core
Package: org.eclipse.ohf.hl7v2.core.definitions.model
File1: DataTypeDefn.java

public boolean escapable() {
  //BEGIN BUGZILLA REPORT 151023 NULLPOINTEREXCEPTION WORKAROUND
  if (name == null) {
    int lastSep = getPath().lastIndexOf(PATH_SEPARATOR);
    name = getPath().substring(lastSep+1);
  }
  //END BUGZILLA REPORT 151023 NULLPOINTEREXCEPTION WORKAROUND
  return name.equals("ST") || name.equals("TX") || name.equals("FT") || name.equals("CF") || name.charAt(0) == '*';
}

Project: org.eclipse.ohf.hl7v2.core
Package: org.eclipse.ohf.hl7v2.core.definitions.model
File2: NamedDefn

public String getName() {
  //BEGIN BUGZILLA REPORT 151023 NULLPOINTEREXCEPTION WORKAROUND
  if (name == null) {
    int lastSep = getPath().lastIndexOf(PATH_SEPARATOR);
    name = getPath().substring(lastSep+1);
  }
  //END BUGZILLA REPORT 151023 NULLPOINTEREXCEPTION WORKAROUND
  return name;
}

Code is allowed which is rejected by javac. A method with a bounded generic type argument is assigned to a result with an unbounded generic type. The inferred type for the generic type argument should be unbounded resulting in a compile error attempting to call the method.

import java.awt.Container;
import java.util.Collection;


public class Demo
{
    private <T extends Container> Collection<T> foo()
    {
        return null;
    }

    private void showProblem()
    {
        Collection<?> result = foo();
    }
}

/* Fails when compiled in javac:

Demo.java:14: incompatible types; inferred type argument(s) ? do not conform to
bounds of type variable(s) T
found   : <T>java.util.Collection<T>
required: java.util.Collection<?>
        Collection<?> result = foo();
                                  ^
1 error

*/

This is a bug in Javac, it fails to infer that under-constrained T should be 'Container'. Note that in a little variable, it does fine.

import java.awt.Container;
import java.util.Collection;

public class X {
	private <T extends Container> Collection<T> foo() {
		return null;
	}

	private void showProblem() {
		Collection<?> result = (Collection<Container>) foo();
	}
}

