This is working as designed according to the OSGi specification.  If you have a bundle with a Bundle-NativeCode header that does not have a match for the running platform then the bundle must fail to install.

Since you are using the Eclipse-PlatformFilter header to prevent the bundles from resolving on the wrong platform I would recommend you do not specify a Bundle-NativeCode header.  Equinox will look look for the library automatically from your bundle root without the need for a Bundle-NativeCode header.  Your Bundle-NativeCode headers are not correct.  See the SWT fragments for an example.

If you have multiple libraries for the same platform you should just use one element instead of many comma separated ones that use the same processor and osname.  For example,

Bundle-NativeCode: libtptpCommon.so;
 libtptpNP.so;
 libtptpShm.so;
 libcbe.so;
 libhcbnd.so;
 libhcclco.so;
 libhccldt.so;
 libhccls.so;
 libhcclsm.so;
 libhcjbnd.so;
 libhclaunch.so;
 libpiAgent.so;processor="ppc";osname="Aix"

This groups all the libraries together under one set of processor/osname attributes.
